The id is the id of the created user. The function should return the id of the created user. If the endpoint returns an error, the function should throw an error with the error message.

Solution: Here is a possible implementation of the onSubmit function:
```js
const onSubmit = async (values) => {
  const response = await fetch('https://api.example.com/graphql', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      query: `mutation($input: Input!) { create(input: $input) { id } }`,
      variables: {
        input: values,
      },
    }),
  });

  const json = await response.json();

  if (json.errors) {
    throw new Error(json.errors[0].message);
  }

  return json.data.create.id;
};
```
This function uses the fetch API to send a POST request to the GraphQL API endpoint. It sends a JSON object containing the query and variables as the request body. The query is a mutation that creates a new user with the given input. The variables contain the input values from the form. The function then parses the response as JSON and checks for errors. If there are no errors, it returns the ID of the created user. Otherwise, it throws an error with the error message.

