I'm trying to make a text-based game in Java, and I'm having trouble with the dialogue system. I want to be able to have multiple choice dialogue, but I'm not sure how to implement it. I've tried using if-else statements, but it's getting really messy and hard to read. Is there a better way to do this?
Here's an example of what I'm trying to do:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
int choice = scan.nextInt();
if (choice == 1) {
    System.out.println("You go left and find a treasure chest.");
    System.out.println("You go right and find a dragon.");
I want to be able to have multiple choices like this, but I'm not sure how to do it without using a ton of if-else statements. Any help would be appreciated!
You can use a switch statement to handle multiple choices in a more concise way. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
int choice = scan.nextInt();
switch (choice) {
        System.out.println("You go left and find a treasure chest.");
        System.out.println("You go right and find a dragon.");
        System.out.println("Invalid choice.");
This way, you can add as many choices as you want without having to use a ton of if-else statements.

